import styled from "styled-components";

const Wrapper = styled.section`
  max-width: var(--max-width);
  margin: 14rem auto;
  margin-top: 14rem;

  .content {
    max-width: var(--max-width-content);
    margin: 0 auto;
  }
`;

export default Wrapper;
